script: |
  super -f tsv -I q2373.sql | sort > q2373.out

inputs:
  - name: q2373.sql
    data: |
      SELECT DISTINCT - tab2.col0 * + NULLIF ( - tab2.col0 + tab2.col0 / tab2.col0, 74 * - tab2.col0 ) AS col2 FROM tab2 GROUP BY tab2.col0;
  - name: tab2

outputs:
  - name: q2373.out
    data: |
      210
      8190
      8372
